import { bytesToHex } from "@helios-lang/codec-utils"
import { decodeUplcProgramV2FromCbor } from "@helios-lang/uplc"

function main() {
    const cborHex =
        ""

    const uplc = decodeUplcProgramV2FromCbor(cborHex)

    const cborHexCheck = bytesToHex(uplc.toCbor())

    if (cborHex != cborHexCheck) {
        throw new Error("round trip failed")
    }
}

main()
